CREATE TABLE busbud(
   id          INTEGER  NOT NULL PRIMARY KEY 
  ,name        VARCHAR(55) NOT NULL
  ,ascii       VARCHAR(55) NOT NULL
  ,alt_name    VARCHAR(1272)
  ,latitude    NUMERIC(8,5) NOT NULL
  ,longitude   NUMERIC(10,5) NOT NULL
  ,feat_class  VARCHAR(1) NOT NULL
  ,feat_code   VARCHAR(5) NOT NULL
  ,country     VARCHAR(6) NOT NULL
  ,cc2         VARCHAR(30)
  ,admin1      VARCHAR(2) NOT NULL
  ,admin2      INTEGER 
  ,admin3      INTEGER 
  ,admin4      VARCHAR(30)
  ,population  INTEGER  NOT NULL
  ,elevation   INTEGER 
  ,dem         INTEGER  NOT NULL
  ,tz          VARCHAR(30) NOT NULL
  ,modified_at DATE  NOT NULL
);
